import React, { useEffect, useState } from 'react';
import './index.css'; 

function UserTable() {
  const [users, setUsers] = useState([]);
  const [addresses, setAddresses] = useState([]);

  const fetchData = async () => {
    try {
      const response1 = await fetch('http://localhost:8000/api/user-name');
      const names = await response1.json();
      const response2 = await fetch('http://localhost:8000/api/address-name');
      const addresses = await response2.json();

      setUsers(names);
      setAddresses(addresses);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="user-table-container">
      <h1>User List</h1>
      <table className="user-table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Address</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user, index) => (
            <tr key={index}>
              <td>{index +1}</td>  
              <td>{user.name}</td>
              <td>{addresses[index] ? addresses[index].address : "N/A"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default UserTable;
